import styles from './styles.module.scss';
import Sidebar from '../../components/shared/sidebar';
import Work from '../../components/home/work';
import About from '../../components/home/about'
import Contact from '../../components/home/contact'

function Home() {
    return (
        <>
            <Sidebar 
                topContent = {[
                    'Jason Yang is a designer who codes.',
                    'He is currently a student at Georgia Tech studying Computational Media.'
                ]}
                bottomLinks = {[
                    'Work',
                    'Resume',
                    'About',
                    'Contact',
                ]}
            />
            <div className={styles.main}>
                <section id='Work'>
                    <Work />
                </section>

                <section id='Resume'>
                    <Resume />
                </section>

                <section id='About'>
                    <About />
                </section>

                <section id='Contact'>
                    <Contact />
                </section>
            </div>
        </>
    )
}

export default Home;
